import React from 'react';
import { useTranslation } from 'react-i18next';
import { trackPricingView } from '../../utils/analytics';

const PricingSection: React.FC = () => {
  const { t } = useTranslation();

  return (
    <section id="pricing" className="section-spacing bg-white relative overflow-hidden">
      <div className="absolute inset-0 bg-gradient-to-br from-slate-50/20 via-transparent to-slate-100/20"></div>
      <div className="max-w-7xl mx-auto px-6 relative">
        <div className="text-center mb-20">
          <h2 className="heading-lg text-slate-900 mb-6 text-balance">
            {t('pricing.title')}
          </h2>
          <p className="text-lg text-slate-600 max-w-2xl mx-auto text-balance">
            {t('pricing.subtitle')}
          </p>
        </div>

        <div className="grid grid-cols-1 lg:grid-cols-3 gap-8">
          {t('pricing.plans', { returnObjects: true }).map((plan: any, index: number) => (
            <div key={index} className={`card p-8 hover-lift ${plan.popular ? 'relative border-2 border-purple-200' : ''}`}>
              {plan.popular && (
                <div className="absolute -top-3 left-1/2 transform -translate-x-1/2">
                  <div className="gradient-bg text-white px-4 py-1 rounded-full text-xs font-medium">
                    {t('pricing.mostPopular')}
                  </div>
                </div>
              )}

              <div className="mb-8">
                <div className="flex items-center space-x-2 mb-2">
                  <span className="text-2xl">{plan.icon}</span>
                  <h3 className="text-xl font-semibold text-slate-900">{plan.name}</h3>
                </div>
                <div className="mb-4">
                  <span className="text-4xl font-semibold text-slate-900">{plan.price}</span>
                  <span className="text-slate-600">/mo</span>
                </div>
                <p className="text-slate-600 mb-6">{plan.description}</p>
                <div className={`rounded-lg p-4 mb-6 border ${plan.popular ? 'bg-gradient-to-r from-green-50 to-blue-50 border-green-100' : 'bg-gradient-to-r from-blue-50 to-purple-50 border-blue-100'}`}>
                  <h4 className="font-medium text-slate-900">{plan.for}</h4>
                </div>
              </div>

              <ul className="space-y-4 mb-8">
                {plan.features.map((feature: string, featureIndex: number) => (
                  <li key={featureIndex} className="flex items-start space-x-3">
                    <svg className="w-5 h-5 text-emerald-500 flex-shrink-0 mt-0.5" fill="currentColor" viewBox="0 0 20 20">
                      <path fillRule="evenodd" d="M10 18a8 8 0 100-16 8 8 0 000 16zm3.707-9.293a1 1 0 00-1.414-1.414L9 10.586 7.707 9.293a1 1 0 00-1.414 1.414l2 2a1 1 0 001.414 0l4-4z" clipRule="evenodd"/>
                    </svg>
                    <span className="text-slate-600 text-sm">{feature}</span>
                  </li>
                ))}
              </ul>

              <a 
                href={plan.buttonLink || "#pricing"} 
                target={plan.buttonLink ? "_blank" : undefined}
                rel={plan.buttonLink ? "noopener noreferrer" : undefined}
                className={`w-full ${plan.popular ? 'button-primary text-white' : 'button-secondary text-slate-900'} py-3 px-6 rounded-lg font-medium shadow-lg text-center block`}
                onClick={() => trackPricingView(plan.name)}
              >
                {plan.button} â†’
              </a>
            </div>
          ))}
        </div>

        {t('pricing.setupServices', { returnObjects: true }) && (
          <div className="mt-20">
            <div className="text-center mb-12">
              <h3 className="text-2xl font-semibold text-slate-900 mb-4">{t('pricing.setupServices.title')}</h3>
              <p className="text-slate-600 max-w-2xl mx-auto">{t('pricing.setupServices.subtitle')}</p>
            </div>

            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 max-w-5xl mx-auto">
              {t('pricing.setupServices.services', { returnObjects: true }).map((service: any, index: number) => (
                <div key={index} className="card p-6 text-center">
                  <h4 className="text-lg font-semibold text-slate-900 mb-2">{service.name}</h4>
                  <p className="text-2xl font-bold text-blue-600 mb-4">{service.price}</p>
                  <p className="text-sm text-slate-600">{service.description}</p>
                </div>
              ))}
            </div>
          </div>
        )}
      </div>
    </section>
  );
};

export default PricingSection;
